import React from 'react';

import logo from './logo.svg';
import './App.css';
import Heroes from './components/heroes';


const hero = [
  {
    name: "Бэтмен", url: "https://n1s1.hsmedia.ru/13/a5/b2/13a5b2373d5e23489d9a4949ada5b927/547x397_0xac120002_8752067681540468870.jpg", universe: "DC Comics", alterego: "Брюс Уэйн", occupation: "борец с преступностью, филантроп, миллиардер",

  }]

function App() {
  return (
    <div className="App">
      <Heroes name="Бэтмен" url="https://n1s1.hsmedia.ru/13/a5/b2/13a5b2373d5e23489d9a4949ada5b927/547x397_0xac120002_8752067681540468870.jpg"></Heroes>
    </div>
  );
}

export default App;
